import React from 'react';

import styled from 'styled-components';
import DataForm from '../../styled/DataForm';
import DataField from '../../styled/DataField';
import SendForm from '../../styled/SendForm';

const Container = styled.div`
	margin: 0 auto;
`;

const Title = styled.h3`
	letter-spacing: 0.8px;
	padding-bottom: 1em;
`;

const StyledSubmit = styled(SendForm)``;

const Login = () => {
	return (
		<Container>
			<DataForm>
				<Title>Login</Title>
				<DataField>
					<input type='text' id='email' placeholder='Email' />
				</DataField>
				<DataField>
					<input type='text' id='password1' placeholder='Password' />
				</DataField>
				<StyledSubmit>Submit</StyledSubmit>
			</DataForm>
		</Container>
	);
};

export default Login;
